import { observable, action, decorate } from "mobx"; 

class SearchsStore { 

  feeds = []; 
  feed = ""; 

  setSearchs(feeds) { 
    this.feeds = feeds; 
  } 

  setSelectedSearch(feed) { 
    this.feed = feed; 
  } 
} 

SearchsStore = decorate(SearchsStore, { 
  searchs: observable, 
  search: observable, 
  setSearchs: action, 
  setSelectedSearch: action, 
}); 

export { SearchsStore };
